import { FC } from "react";
import Header from "../modules/Header/Header";
import Footer from "../modules/Footer/Footer";
import Tabs from "../modules/Tabs/Tabs";

interface HomeProps {}

const Home: FC<HomeProps> = () => {
  return (
    <div>
      <Header />
      <Tabs />
      <Footer />
    </div>
  );
};

export default Home;
